To create an `aws_route_table` resource in `custom_vpc.tf` and associate the two private subnets `Private-1A` and `Private-1B` with it, you can follow these steps:

1. First, create the `aws_route_table` resource block in `custom_vpc.tf`:

```hcl
resource "aws_route_table" "private_route_table" {
  vpc_id = aws_vpc.custom_vpc.id

  tags = {
    Name = "Private Route Table"
  }
}
```

This will create a new route table named "Private Route Table" within the custom VPC.

2. Next, associate the two private subnets with the route table using the `aws_route_table_association` resource:

```hcl
resource "aws_route_table_association" "private_1a" {
  subnet_id      = aws_subnet.private_1a.id
  route_table_id = aws_route_table.private_route_table.id
}

resource "aws_route_table_association" "private_1b" {
  subnet_id      = aws_subnet.private_1b.id
  route_table_id = aws_route_table.private_route_table.id
}
```

Here, we're creating two `aws_route_table_association` resources, one for each private subnet. The `subnet_id` is the ID of the respective private subnet (`aws_subnet.private_1a.id` and `aws_subnet.private_1b.id`), and the `route_table_id` is the ID of the route table we created earlier (`aws_route_table.private_route_table.id`).

Make sure to replace `aws_subnet.private_1a` and `aws_subnet.private_1b` with the actual resource names you have defined in `custom_vpc.tf` for the two private subnets.

After applying these changes, the two private subnets `Private-1A` and `Private-1B` will be associated with the newly created "Private Route Table" within the custom VPC.
